import React from 'react';

const PostsList = (props) => {

    const posts = props.posts.map((post, i) => {
        return(
            <div key={post._id}>
                <p>{post.title}<br/>
                   {post.commentBody}
                   <button onClick={props.deletePost.bind(null, post._id)}>delete</button>
                   <button onClick={props.editPost.bind(this, post._id)}>Edit</button>
                </p>

            </div>

        )

    })


    return(
        <div>
           {posts}
        </div>
    )
}

export default PostsList;
